import React from "react"

import propTypes from "prop-types"

export const Button = (
  {
    text,
    wrapperClass,
  }) => {
  return (
    <div>
      {text}
    </div>
  )
}

Button.defaultProps = {
  text: "Save"
}

Button.propTypes = {
  text: propTypes.string
}
